export default {
  game: false,
  barReady: false,
  bricks: Array.apply(null, Array(14 * 6)).map((v, id) => {
    return { id, alive: true };
  }),
  ballv: 6,
  ballxv: 1,
  ballyv: 1,
  ballx: window.innerWidth / 2 - 12,
  ballx: window.innerHeight - 99
};
